import './App.css';

import {BrowserRouter,Routes,Route,Link} from 'react-router-dom'
import MyShift from './Pages/MyShift';
import AvailableShift from './Pages/AvailableShift';
function App() {
  return (
    <BrowserRouter>
     <nav className='App'>
      <div id='Nav'><Link to="/MyShift">My Shift </Link></div>

      <div id='Nav'><Link to="/AvailableShift"> Available Shift</Link></div>
     </nav>
     <Routes>
      <Route path="/MyShift" element={<MyShift/>}/>
      <Route path="/AvailableShift" element={<AvailableShift/>}/>
     </Routes>
    </BrowserRouter>

  );
}

export default App;
